 // 菜单是否处于激活状态，如选中一段加粗文字时，bold 菜单要被激活（即高亮显示）\n\n    constructor($elem: DomElement, editor: Editor) {\n        this.$elem = $elem\n        this.editor = editor\n        this._active = false\n\n        // 绑定菜单点击事件\n        $elem.on('click', (e: Event) => {\n            Panel.hideCurAllPanels() // 隐藏当前的所有 Panel\n\n            // 触发菜单点击的钩子\n            editor.txt.eventHooks.menuClickEvents.forEach(fn => fn())\n\n            e.stopPropagation()\n            if (editor.selection.getRange() == null) {\n                return\n            }\n            this.clickHandler(e)\n        })\n    }\n\n    /**\n     * 菜单点击事件，子类可重写\n     * @param e event\n     */\n    protected clickHandler(e: Event): void {}\n\n    /**\n     * 激活菜单，高亮显示\n     */\n    protected active(): void {\n        this._active = true\n        this.$elem.addClass('w-e-active')\n    }\n\n    /**\n     * 取消激活，不再高亮显示\n     */\n    protected unActive(): void {\n        this._active = false\n        this.$elem.removeClass('w-e-active')\n    }\n\n    /**\n     * 是否处于激活状态\n     */\n    public get isActive() {\n        return this._active\n    }\n}\n\nexport default Menu\n"]},_coverageSchema:"1a1c01bbd47fc00a2c39e90264f33305004495a9",hash:"4a6d6861c9e9e91839aaef33ec1999409e059735"},o=e[t]||(e[t]={});o[n]&&"4a6d6861c9e9e91839aaef33ec1999409e059735"===o[n].hash||(o[n]=l);var i=o[n];return A=function(){return i},i}A();var r=(A().s[0]++,void A().b[0][0]++&&(A().b[0][1]++,(void 0).__importDefault)||(A().b[0][2]++,function(n){return A().f[0]++,A().s[1]++,A().b[2][0]++,n&&(A().b[2][1]++,n.__esModule)?(A().b[1][0]++,n):(A().b[1][1]++,{default:n})}));A().s[2]++,(0,o.default)(e,"__esModule",{value:!0});var a=(A().s[3]++,r(t(35))),s=(A().s[4]++,function(){function n(n,e){A().f[2]++;var t=(A().s[5]++,this);A().s[6]++,this.$elem=n,A().s[7]++,this.editor=e,A().s[8]++,this._active=!1,A().s[9]++,n.on("click",(function(n){var l;if(A().f[3]++,A().s[10]++,a.default.hideCurAllPanels(),A().s[11]++,(0,i.default)(l=e.txt.eventHooks.menuClic